import React from "react";
import "./Footer.css";
import "./HorizontalneListe.css";
import HorizontalnaLista from "./HorizontalneListe";
import Ikona from "./Ikonica.js";
import "./Ikonica.css";
import face from "./fb.png";
function Footer(){
    const fb = {
        src: face,
        alt: "facebook"
    }
    return(
        
            <footer>
                <div id="tekst">
                    <HorizontalnaLista prvi="ABOUT" drugi="TEAM" treci="CONTACT"/>
                </div>
                <div id="ikone">
                     <HorizontalnaLista prvi={<Ikona url={fb.src}/>} drugi="njfnd"/>
                </div>
            </footer>
       
    );
}

export default Footer;
